SELECT "amount", count("id"), SUM("amount") FROM "Payment" where "createdAt" >= {{moment(DatePicker1.selectedDate).format("YYYY-MM-DD")}}::date - interval '330 minutes' 
  AND "createdAt" <= {{moment(DatePicker2.selectedDate).format("YYYY-MM-DD")}}::date + interval '1110 minutes' 
  AND "status" = 'responseReceivedSuccess' AND "amount" IN ('3398', '4198') AND "paymentForId" IS NULL GROUP BY "amount";
